import React from 'react';
import Navbar from './Navbar';
import '../assets/css/Dashboard.css';
import Test from './Test';
import { Routes, Route, Link } from 'react-router-dom';  // Correct import

function Dashboard() {
  return (
    <div className="App-dashboard">
      <Navbar />
      <div className="dashboard-content">
        <div className="profile-box">
          <div className="menu">
            <ul>
              <li><Link to="/dashboard/test1">About</Link></li> {/* Correct path */}
              <li><Link to="/dashboard/test2">Contact</Link></li> {/* Correct path */}
            </ul>
          </div>
          <div className="dashboard-frameset">
            <Routes>
              <Route path="/" element={<Test />} />
              <Route path="test1" element={<Test />} />
              <Route path="test2" element={<Test />} />
            </Routes>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
